import React from "react";
import "./Popup.css";

const PopupCard = ({ onClose }) => {
  return (
    <div className="popup-card-overlay">
      <div className="popup-card">
        <h1>This is the popup card</h1>
        <button onClick={onClose}>Close</button>
      </div>
    </div>
  );
};

export default PopupCard;
